oxy_webhelp_navlinks = {"feature_list_with_all_features_intro-d43829e4541":{"topics":[{"title":"Email notification management - new parameters","shortdesc":"<p class=\"shortdesc\">This feature provides more parameters for the         configuration of email notifications, namely service availability and performance         parameters.<\/p>","href":"modules\/cleva_integration_hub\/feature\/code_169576_en\/code_169576.html","attributes":{"data-id":"code_169576"},"menu":{"hasChildren":false},"tocID":"code_169576-d43829e4556","topics":[]},{"title":"Database auditing","shortdesc":"<p class=\"shortdesc\">With this feature, all data changes performed in Cleva         Integration hub will be registered and will be available in the corresponding details         area.<\/p>","href":"modules\/cleva_integration_hub\/feature\/code_144580_en\/code_144580.html","attributes":{"data-id":"code_144580"},"menu":{"hasChildren":false},"tocID":"code_144580-d43829e4574","topics":[]},{"title":"Mapping of modified service parameters","shortdesc":"<p class=\"shortdesc\">This feature provides a process for mapping modified         parameters of services registered in Cleva Integration hub.<\/p>","href":"modules\/cleva_integration_hub\/feature\/code_155475_en\/code_155475.html","attributes":{"data-id":"code_155475"},"menu":{"hasChildren":false},"tocID":"code_155475-d43829e4592","topics":[]},{"title":"Cleva Integration hub's jobs in the new Cleva batch console","shortdesc":"<p class=\"shortdesc\">From version 7.11 onwards, all Cleva Integration hub's         jobs are available in the new Cleva batch console.<\/p>","href":"modules\/cleva_integration_hub\/feature\/code_151818_en\/code_151818.html","attributes":{"data-id":"code_151818"},"menu":{"hasChildren":false},"tocID":"code_151818-d43829e4610","topics":[]},{"title":"Notifications - dispatcher's status alert","shortdesc":"<p class=\"shortdesc\">With version 7.11, Cleva Integration hub's email         notifications feature is able to send notifications to inform about the status of the         dispatcher.<\/p>","href":"modules\/cleva_integration_hub\/feature\/code_155497_en\/code_155497.html","attributes":{"data-id":"code_155497"},"menu":{"hasChildren":false},"tocID":"code_155497-d43829e4628","topics":[]},{"title":"Cleva Integration hub as iFrame in Cleva Frontend factory","shortdesc":"<p class=\"shortdesc\">With version 7.11, Cleva Integration hub's menus are         integrated in Cleva Frontend factory as menu options.<\/p>","href":"modules\/cleva_integration_hub\/feature\/code_155527_en\/code_155527.html","attributes":{"data-id":"code_155527"},"menu":{"hasChildren":false},"tocID":"code_155527-d43829e4646","topics":[]},{"title":"Traceability - customised filters","shortdesc":"<p class=\"shortdesc\">This feature allows users to define their own filters in         the <strong class=\"ph b\">Tracebility<\/strong> area. <\/p>","href":"modules\/cleva_integration_hub\/feature\/code_143567_en\/code_143567.html","attributes":{"data-id":"code_143567"},"menu":{"hasChildren":false},"tocID":"code_143567-d43829e4664","topics":[]},{"title":"Cleva Integration hub in the cloud","shortdesc":"<p class=\"shortdesc\">From version 7.11 onwards, Cleva Integration hub will         support cloud implementations with a single installation able to support the registration of         events of several clients (tenants) with different versions.<\/p>","href":"modules\/cleva_integration_hub\/feature\/code_157903_en\/code_157903.html","attributes":{"data-id":"code_157903"},"menu":{"hasChildren":false},"tocID":"code_157903-d43829e4685","topics":[]},{"title":"Contexts management","shortdesc":"<p class=\"shortdesc\">With version 7.11, there is a new area available in Cleva         Integration hub that allows managing business contexts. The business contexts managed in         this area will be used to search for events in the traceability area.<\/p>","href":"modules\/cleva_integration_hub\/feature\/code_136977_en\/code_136977.html","attributes":{"data-id":"code_136977"},"menu":{"hasChildren":false},"tocID":"code_136977-d43829e4703","topics":[]},{"title":"Web services catalogue - auditing tool","shortdesc":"<p class=\"shortdesc\">With version 7.11, there is new tool available that allows         comparing and identifying possible discrepancies between a client's web services and the         catalogue of web services to install.<\/p>","href":"modules\/cleva_integration_hub\/feature\/code_155467_en\/code_155467.html","attributes":{"data-id":"code_155467"},"menu":{"hasChildren":false},"tocID":"code_155467-d43829e4721","topics":[]}]}};